import React from 'react'
import { useGlobalContext } from '../context'

const Roles = () => {
    const {roles} = useGlobalContext()
    console.log(roles)
    const [data, setData] = useState(roles)
    const columns = [
        {title: "deleted", field: "deleted"},
        {title: "role_id", field: "role_id"},
        {title: "role_name", field: "role_name"},
    ]
  return (
    <div>
        <MaterialTable
        title="Roles Table"
        data={data}
        columns={columns}
        />
    </div>
  )
}

export default Roles
